import React ,{useState} from 'react';
import Navbar from './components/Navbar';
import Calling from './components/project_1/calling_back';
import Table from './components/project_2/table';
import ErrorBoundary from './components/ErrorBoundary'; // Adjust the path as necessary
import "./App.css";

function App() {
  const [searchTerm, setSearchTerm] = useState('');

  return (
    <>
    <ErrorBoundary>
        <Navbar setSearchTerm={setSearchTerm}/>
      </ErrorBoundary>
      <BrowserRouter>
    <Routes>
    <Route path='/' element={<Places searchTerm={searchTerm} />} />
      <Route path='/book/:id' element={<Booking />}/>
      <Route path='/login' element={<Login />}/>
      <Route path='/signup' element={<Signup />}/>
      <Route path='/payment' element={<Payment />}/>
      </Routes></BrowserRouter>
    </>
  );
}

export default App;
